<script type="text/javascript">
var scene1 = document.getElementById("scene1"),
    scene2 = document.getElementById("scene2"),
    last = document.getElementById("Last"),
    next = document.getElementById("Next"),
    textBox = document.getElementById("Textbox_1_"),
    green = document.getElementById("Green"),
    brown = document.getElementById("Brown"),
    theEnd = document.getElementById("The_End");

function fadeIn(obj, secs) {
    setTimeout(function() {

        var el = document.getElementById(obj);
        document.getElementById(el.id).style.display = "block";

        var op = parseFloat(el.style.opacity);

        var timer = setInterval(function() {
            if (op >= 1.0)
                clearInterval(timer);

            op += 0.1;
            el.style.opacity = op;
        }, 50);

    }, secs);

}
scene1.style.display = "block";
fadeIn("scene1", 500);

setTimeout(function() {
    brown.style.display = "block";
    green.style.display = "none";
    scene2.style.display = "block";
    scene1.style.display = "none";
}, 1500);

setTimeout(function() {
    fadeIn("Textbox_1_", 500);
    fadeIn("Last", 1500);
    last.setAttribute("onclick", "closeScenes();");
}, 2500);

function closeScenes() {
    last.style.display = "none";
    scene2.style.display = "none";
    textBox.style.display = "none";
    theEnd.style.display = "block";
    fadeIn("TheEnd", 1500);
    setTimeout(function() {
        location.href = "../index.html";
    }, 2000)
}
</script>
